    this.state = {};
  }
  componentDidMount() {
    console.log(this.threeJsViewer);
    this.renderer = Renderer.initRenderer(this.threeJsViewer);
    this.guiController = Renderer.initGuiControl(this.threeJsGuiController);
  }
  render() {
    return (
      <div className={componentStyle.container}>
        <div className={componentStyle["params-input"]}></div>
        <div>
          <div className={componentStyle["echart-viewer"]}></div>
        </div>
      </div>
    );
  }
}
